Edgeplay: A film about The Runaways is a 2004 documentary that chronicles the rise and disintegration of the seminal '70's all-teenage-girl rock band The Runaways, whose members included then-unknown future rock stars Lita Ford and Joan Jett. The film explores the effects of verbal, emotional and psychological abuse on girls too young to drink, but old enough for sex, drugs and rock n' roll.
